import React from 'react';
import Inventory from './Inventory';
import Recipe from './Recipe';

export default function RecipeList({recipes}) {
    return (
        <>
        {recipes.map(recipe=>{
            <Recipe 
            key={recipe.id} 
            {...recipe}    
            />

        },
        <Inventory/>
        )}

        </>
    )
}
